import { useDispatch, useSelector } from "react-redux";
import { calculatorActionTypes } from "../store";
import classes from "./Counter.module.css";

const Calculator = () => {
  const result = useSelector((state) => state.calculator.result);
  const dispatch = useDispatch();

  const addHandler = () => {
    dispatch({ type: calculatorActionTypes.ADD, payload: 5 });
  };
  const divideHandler = () => {
    dispatch({ type: calculateActionTypes.DIVIDE, payload: 4 });
  };

  const subtractHandler = () => {
    dispatch({ type: calculateActionTypes.SUBTRACT, payload: 10 });
  };
  const multiplayHandler = () => {
    dispatch({ type: calculateActionTypes.MULTIPLAY, payload: 2 });
  };

  return (
    <main className={classes.counter}>
      <h1>Redux Calculate</h1>
      <div className={classes.value}>Result:{result}</div>
      <button onClick={addHandler}>+5</button>
      <button onClick={subtractHandler}>-10</button>
      <button onClick={multiplayHandler}>*2</button>
      <button onClick={divideHandler}>/4</button>
    </main>
  );
};

export default Calculator;
